import './App.css';

function App() {
  const title = 'o s m o s y s'
  const something = 999
  return (
    <div className="App">
      <div className="content">
        <h1> {title} </h1>
        <p> Money Raised: {something} </p>
      </div>
    </div>
  );
}

export default App;
